pragma solidity ^0.8.18;
import "hardhat/console.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "erc721a/contracts/ERC721A.sol";

interface IDisc is IERC721Enumerable {
    function burnFromContract(uint discID_) external;

    function returnDiscLevel(uint index) external view returns (uint);

    function increaseDiscLevel(uint discID_) external;
}

contract PepeStaking is ERC20Burnable, Ownable {
    constructor(uint256 initialSupply) ERC20("PEPE", "PEPE") {}

    event BurnedDisc(bool burned);

    // Structs needed:

    struct DiscProperties {
        address owner;
        uint inDrive;
        uint startDate;
    }

    struct CharacterProperties {
        address owner;
        uint startDate;
    }

    enum TokenType {
        DISC,
        DRIVE
    }

    // Mappings:
    address pepeDriveIIAddress;
    address discContractAddress;
    address characterAddress;

    mapping(address => mapping(TokenType => uint256[])) public stakedTokens;

    mapping(uint => address) public ownerOfDrive;
    mapping(uint => bool) public discInDrive;
    mapping(uint => DiscProperties) public disc;

    function setPepeDriveIIAddress(
        address pepeDriveIIAddress_
    ) public onlyOwner {
        pepeDriveIIAddress = pepeDriveIIAddress_;
    }

    function returnTokensOfOwner(
        address discOwner_,
        TokenType tt_
    ) public view returns (uint[] memory) {
        return stakedTokens[discOwner_][tt_];
    }

    function setCharacterAddress(address characterAddress_) public onlyOwner {
        characterAddress = characterAddress_;
    }

    function setDiscContractAddress(
        address discContractAddress_
    ) public onlyOwner {
        discContractAddress = discContractAddress_;
    }

    function stakeDrive(uint driveID_) public {
        IERC721A pepeDriveII = IERC721A(pepeDriveIIAddress);
        require(
            pepeDriveII.ownerOf(driveID_) == msg.sender,
            "you are not the owner"
        );
        stakedTokens[msg.sender][TokenType.DRIVE].push(driveID_);
        ownerOfDrive[driveID_] = msg.sender;
        pepeDriveII.transferFrom(msg.sender, address(this), driveID_);
    }

    function unstakeDrive(uint driveID_) public {
        IERC721A pepeDriveII = IERC721A(pepeDriveIIAddress);
        require(ownerOfDrive[driveID_] == msg.sender, "you are not the owner");
        require(discInDrive[driveID_] == false, "empty drive first");

        ownerOfDrive[driveID_] = address(0);

        removeToken(driveID_, TokenType.DRIVE);

        pepeDriveII.transferFrom(address(this), msg.sender, driveID_);
    }

    function stakeDisc(uint driveID_, uint discID_) public {
        IDisc discContract = IDisc(discContractAddress);
        require(discInDrive[driveID_] == false, "drive already full");

        require(
            ownerOfDrive[driveID_] == msg.sender,
            "you are not the owner of the drive"
        );
        require(
            discContract.ownerOf(discID_) == msg.sender,
            "you are not the owner of the disc"
        );

        stakedTokens[msg.sender][TokenType.DISC].push(discID_);
        discInDrive[driveID_] = true;
        disc[discID_].owner = msg.sender;
        discContract.increaseDiscLevel(discID_);
        disc[discID_].inDrive = driveID_;
        disc[discID_].startDate = block.timestamp;

        discContract.transferFrom(msg.sender, address(this), discID_);
    }

    function burnPepe(address sender, uint amount_) public {
        require(msg.sender == characterAddress, "only burnable from minting");
        _burn(sender, amount_);
    }

    function burnMyPepe(uint amount_) public {
        _burn(msg.sender, amount_);
    }

    function ejectDisc(uint discID_) public {
        IDisc discContract = IDisc(discContractAddress);
        require(
            disc[discID_].owner == msg.sender,
            "you are not the owner of the disc"
        );
        bool burn = false;
        uint amountOfPepe = 0;

        if (calculateDay(disc[discID_].startDate) > 6) {
            burn = true;
        } else {
            burn = calculateBurn(discID_, msg.sender);
        }

        if (burn) {
            discContract.burnFromContract(discID_);
        } else {
            amountOfPepe = calculatePepe(discID_);

            discContract.increaseDiscLevel(discID_);
            _mint(msg.sender, amountOfPepe);
            discContract.transferFrom(
                address(this),
                disc[discID_].owner,
                discID_
            );
        }

        discInDrive[disc[discID_].inDrive] = false;
        removeToken(discID_, TokenType.DISC);
        emit BurnedDisc(burn);
    }

    function calculateDay(uint256 startDate_) internal view returns (uint) {
        uint256 day = ((block.timestamp - startDate_) / 1 days);
        return day;
    }

    function calculateBurn(
        uint discID_,
        address initiator_
    ) internal view returns (bool burned) {
        IDisc discContract = IDisc(discContractAddress);
        uint256 randomNumber = random(discID_, initiator_);
        uint256 ejectionNumber = discContract.returnDiscLevel(discID_);

        if (ejectionNumber == 1) {
            // 10% chance of burn
            if (randomNumber % 10 == 0) {
                burned = true;
            }
        } else if (ejectionNumber == 2) {
            // 25% chance of burn
            if (randomNumber % 4 == 0) {
                burned = true;
            }
        } else {
            // 50% chance of burn
            if (randomNumber % 2 == 0) {
                burned = true;
            }
        }
        return burned;
    }

    function calculatePepe(uint discID_) public view returns (uint) {
        IDisc discContract = IDisc(discContractAddress);
        uint level = discContract.returnDiscLevel(discID_);
        uint day = calculateDay(disc[discID_].startDate);
        uint pepe = 0;

        if (level == 1) {
            pepe = 420 * day;
        } else if (level == 2) {
            pepe = 690 * day;
        } else if (level > 2) {
            pepe = 888 * day;
        }
        return pepe;
    }

    function random(
        uint256 discId_,
        address initiator_
    ) private view returns (uint pseudoRandomness) {
        pseudoRandomness = uint(
            keccak256(
                abi.encodePacked(
                    blockhash(block.number - 1),
                    discId_,
                    initiator_
                )
            )
        );

        return pseudoRandomness;
    }

    function removeToken(uint256 tokenId, TokenType tt_) internal {
        uint256[] storage stakedTokenIds = stakedTokens[msg.sender][tt_];

        for (uint256 i = 0; i < stakedTokenIds.length; i++) {
            if (stakedTokenIds[i] == tokenId) {
                stakedTokenIds[i] = stakedTokenIds[stakedTokenIds.length - 1];
                stakedTokenIds.pop();
                break;
            }
        }
    }
}
